  false,\n\t\"url\": null,\n\t\"notes\": \"On March 20, 2007, experts from several
  disciplines with the Service, USGS, State, Montana State University and private
  industry met in Lewistown, MT to discuss elevated salinity and selenium concentrations
  at Hailstone NWR. Research on the salinity and selenium issue at Hailstone NWR was
  initiated in 2001 , but work on saline seep impacts in Lake Basin has been ongoing
  for the past 30+ years. Hailstone and several other National Wildlife Refuges in
  Montana and the Dakotas have similar issues in regards to salt loading and selenium
  contamination. The goal of this summit was to discuss possible solutions to reduce/mitigate
  the salinity and eventually selenium impacts Hailstone NWR before Halfbreed NWR
  and Big Lake Wildlife Management Area (WMA), located downstream 1 are similarly
  impacted.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
